import React from "react"
import { Box } from "@mui/system"
import { Button, Container } from "@mui/material"
import MainNav from "../Components/layout/MainNav"
import AutoNav from "../Components/AutoNav"

export default function Homepage(){

    return(
        
        <Box sx={{
            display:'flex',
            flexDirection: 'Column', 
        }}>
            <MainNav/>
            <Box sx ={{
                display:'flex',
                flexDirection:'row'
            }}>
                <Box sx={{
                    display:'flex',
                    width: '50%',
                    justifyItems: 'center'
                }}>
                    <Container>
                        <header>Mode selector</header>
                        <Button>Manual mode</Button>
                        <Button>Follow mode</Button>
                    </Container>
                </Box>
                <Box sx={{
                    display:'flex',
                    width: '50%',
                    justifyItems: 'center'
                }}>
                    {/* <AutoNav/> */}
                    <Container>
                        <header>Destination select</header>
                        <Button>Home</Button>
                        <Button>Kitchen</Button>
                    </Container>
                </Box>
            </Box>
        </Box>
    )
}
